import React from "react";
import {listDecks} from "../utils/api/index";


listDecks().then(console.log)


function Decks() {
    listDecks().map((deck) => {
        <Card>
            <Card.Body>{deck}</Card.Body>
        </Card>
    })
}

function Home() {
    return (
        <div>
            <Decks/>
        </div>
    )

}


export default Home;
